import React from 'react';

import TableCell from '@material-ui/core/TableCell';

class RankingCard extends React.Component {
  render() {
    return (
      <div>
      <TableCell component="th" scope="row">
        {console.log(this.state)}
      </TableCell>
      <TableCell align="right"><img src={row.u_icon} /></TableCell>
      <TableCell align="right">{row.u_name}</TableCell>
      <TableCell align="right">{row.u_month_bc}</TableCell>
      <TableCell align="right">BC</TableCell>

      </div>
    );
  }
}

export default RankingCard;
